import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import UserHomePage from './pages/UserHomePage';
import Login from './pages/Login'; // Ensure you import the Login page
import UserNavbar from './components/UserNavbar';

function App() {
  const handleLogout = () => {
    // Perform logout logic here (e.g., clearing sessionStorage or localStorage)
    localStorage.removeItem('user'); // Example: remove user data from localStorage
    // Redirect to login page after logout
    window.location.href = '/login';
  };

  return (
    <Router>
      <UserNavbar />
      <Routes>
        <Route path="/user-home" element={<UserHomePage />} />
        <Route path="/login" element={<Login />} />
        {/* Add a route to handle logout */}
        <Route path="/logout" element={null} /> {/* Just to handle the /logout path */}
      </Routes>
    </Router>
  );
}

export default App;
